- input: TEXT,F3XA,,Dollars for Democrats  provided us with memo Schedule A's for
    the fourth quarter of 2002 after year end. No transfer-in was received within
    this report period. Expenditures for voter registration and GOTV activities were
    generic activities encouraging people to vote and did not reference House or Senate
    candidates. Receipts from Michelle Laherty  Barbara Smith Warner Samuella Greenstein
    and Meghan Moyer offset expenses originally reported as allocable. However no
    non-federal transfer was made for the expenses. Therefore they have been amended
    and reported as Other Disbursements reported on Schedule B for Line 29. Receipt
    from American Economy Insurance Company was an insurance claim for a stolen computer.
    The disbursement to pay for the replacement computer was dated 12/12/02 to DLJ
    System and Hewlett Packard reported on Schedule B for Line 29.
